import axios from 'axios'

const CATEGORY = 'in28minutes'
const GROCERY_API_URL = 'http://localhost:9000'
const CATEGORY_API_URL = `${GROCERY_API_URL}/instructors/${CATEGORY}`

class GroceryDataService {

    retrieveAllCourses(name) {
        //console.log('executed service')
        return axios.get(`${CATEGORY_API_URL}/courses`);
    }

    retrieveCourse(name, id) {
        //console.log('executed service')
        return axios.get(`${CATEGORY_API_URL}/courses/${id}`);
    }

    deleteCourse(name, id) {
        //console.log('executed service')
        return axios.delete(`${CATEGORY_API_URL}/courses/${id}`);
    }

    updateCourse(name, id, course) {
        //console.log('executed service')
        return axios.put(`${CATEGORY_API_URL}/courses/${id}`, course);
    }

    createCourse(name, course) {
        //console.log('executed service')
        return axios.post(`${CATEGORY_API_URL}/courses/`, course);
    }
}

export default new GroceryDataService()
